Step‐by‐step reasoning:
1. Key psychological mechanisms include self‐interest (the offered monetary share) and fairness concerns, where the participant compares the offer against a fairness reference computed from their token contribution relative to the total combined tokens and the combined earnings. Deviations in either direction (offer being more or less than “fair”) alter the perceived utility.
2. These mechanisms interact by adding a bonus when the offer exceeds the fairness reference and imposing a penalty when the offer falls short. This reflects a reference‐dependent evaluation process with diminishing sensitivity.
3. To capture these interactions mathematically, we first compute a fairness benchmark f defined as f = (token_self/(token_self+token_opp)) × combined_earning. Then we define the difference Δ = split_self − f. The utility is computed piecewise: when the offer is above the fairness benchmark (Δ ≥ 0), a bonus proportional to (Δ)^γ is added; when the offer is below the fairness benchmark (Δ < 0), a penalty proportional to (|Δ|)^γ is subtracted, scaled by a loss‐aversion parameter λ.
4. We introduce two learnable parameters: γ (gamma) governing the curvature or sensitivity (diminishing sensitivity) to deviations, and λ (lambda_param) capturing the stronger negative reaction (loss aversion) to perceived unfairness.
5. Observable behavior is driven by split_self (the offered amount to self) and the tokens and combined_earning that form the fairness reference. The computed utility U_accept predicts the likelihood of accepting an offer (more negative utility values correspond to actions that are less likely chosen).

The formal model is as follows:

<MODEL>
Let f = (token_self / (token_self + token_opp)) × combined_earning  
Let Δ = split_self − f  
Then,  
U_accept = { split_self + (Δ)^gamma,       if Δ ≥ 0  
             split_self − lambda_param × (−Δ)^gamma,  if Δ < 0 }
</MODEL>

